for mn=1:7
  scatter3(moCap_avg(3*(mn-1)+1), moCap_avg(3*(mn-1)+2), moCap_avg(3*(mn-1)+3))
end
axis equal
xlabel('x')
ylabel('y')
zlabel('z')
legend(legend_arr);

RecM = [0 0 -1; -1 0 0; 0 1 0]
marker_arr = [];
for mn=1:7
  marker_arr = [marker_arr; moCap_avg(3*(mn-1)+1:3*(mn-1)+3)];
end
marker_arr_rect = (RecM * marker_arr')'

figure; hold on
for i=1:7
scatter3(marker_arr_rect(i,1), marker_arr_rect(i,2), marker_arr_rect(i,3))
end
axis equal
xlabel('x')
ylabel('y')
zlabel('z')
legend(legend_arr);